\newcommand{\ud}{\mathrm{d}}
$$ \frac{\partial U}{\partial t} + \frac{\partial F}{\partial x} = S$$
\begin{center}
with e.g.:
\end{center}
\begin{align*}
U &= [p \quad \dot{m}]^T\\
F &= \left[ \frac{\dot{m}}{A^\text{atm}\rho^\text{atm}\beta^\text{total}_P} \quad \dot{m}\nu + Ap \right]^T\\
S &= \left[ 0 \quad \rho A g \cos{\theta_p} - \frac18 f_D\pi\rho D\nu|\nu|\right]^T
\end{align*}
